INSERT INTO `journal_encounter` (`Name`, `Description`, `MapX`, `MapY`, `ID`, `JournalInstanceID`, `DungeonEncounterID`, `OrderIndex`, `FirstSectionID`, `UiMapID`, `MapDisplayConditionID`, `Flags`, `DifficultyMask`, `VerifiedBuild`) VALUES
('Tred\'ova', 'The gorm have been chewing at the edges of Ardenweald, devouring desiccated husks of the dead. The beast called Tred\'ova has gorged herself on something far more precious, the wildseed of Lakali, loa of knowledge. Now that Tred\'ova has tasted the loa\'s power and wisdom, she hungers for more than survival.', 0.154065996408462524, 0.745705008506774902, 2405, 1184, 2393, 3, 21746, 1669, 0, 0, -1, 54673),
('Gal\'darah', 'The Drakkari turned to their loa as the Scourge invaded the nation of Zul\'Drak. The frost trolls did not come to the loa with implorations; they came with blades. As blood flowed from their murdered god, Akali, the high prophet Gal\'darah and his betrayers claimed the loa\'s strength as their own.', 0.465846985578536987, 0.270491987466812133, 596, 274, 1981, 5, 6989, 154, 0, 0, -1, 54673),
('Moorabi', 'The Drakkari sought to sacrifice Mam\'toth for his powers, but instead the loa destroyed himself. Despite this act, Moorabi would not be denied his god-like powers. The high prophet drank of the loa\'s blood and will now stop at nothing to keep Zul\'Drak firmly in troll hands.', 0.393442004919052124, 0.489753991365432739, 594, 274, 1980, 3, 6980, 154, 0, 0, -1, 54673);
