(1670, 'Random Dungeon (Battle for Azeroth)', '', 6, 1, -1, 0, 0, 337493, 7, -1, 1, 0, 57, 1, 114864, 0, 0, 0, 1, 1, 3, 1, 1, 3, 0, 0, 0, 500, 16387, 17424, 54673),
(2713, 'Fate of Amirdrassil', 'Fyrakk has reached the heart of Amirdrassil and threatens to consume its power for his own.', 1, 2, -1, 5409263, 5409269, 5409265, 9, 2549, 17, 463, 0, 11, 124043, 0, 0, 2519, 2, 5, 18, 1, 4, 13, 0, 0, 0, 2608, 16411, 16384, 54673),
(2712, 'The Viridian Weave', 'Nymue weaves the mesmerizing patterns of the Emerald Dream. Our intrusion has distrupted the weave, and we will be dealt with.', 1, 2, -1, 5409263, 5409267, 5409265, 9, 2549, 17, 463, 0, 10, 124041, 0, 0, 2556, 2, 5, 18, 1, 4, 13, 0, 0, 0, 2608, 16411, 16384, 54673),
(2711, 'Molten Incursion', 'Larodar, twisted by flame, seeks to bathe the Emerald Dream in fire. If successful, everything will be reduced to ash.', 1, 2, -1, 5409263, 5409268, 5409265, 9, 2549, 17, 463, 0, 9, 124033, 0, 0, 2553, 2, 5, 18, 1, 4, 13, 0, 0, 0, 2608, 16411, 16384, 54673),
(2710, 'Incarnate\'s Wake', 'Smolderon has forced his way into the Emerald Dream. If left unchecked, his forces will burn everything in their path.', 1, 2, -1, 5409263, 5409264, 5409265, 9, 2549, 17, 463, 0, 8, 124031, 0, 0, 2563, 2, 5, 18, 1, 4, 13, 0, 0, 0, 2608, 16411, 16384, 54673),
(2709, 'Edge of the Void', 'Sarkareth stands at the edge of the abyss, seeking to harness Neltharion\'s power and claim the former Earth-Warder\'s legacy.', 1, 2, -1, 5149415, 5150068, 5149425, 9, 2569, 17, 463, 0, 7, 124030, 0, 0, 2520, 2, 5, 18, 1, 4, 13, 0, 0, 0, 2648, 16411, 16384, 54673),
(2708, 'Neltharion\'s Shadow', 'Something stirs in the dark... it once corrupted the Earth-Warder, and now it is eager to claim new victims.', 1, 2, -1, 5149415, 5150067, 5149425, 9, 2569, 17, 463, 0, 6, 124027, 0, 0, 2532, 2, 5, 18, 1, 4, 13, 0, 0, 0, 2648, 16411, 16384, 54673),
(2707, 'Fury of Giants', 'The Zaqali warband has launched a devastating assault on the crucible in order to destroy anything in their path.', 1, 2, -1, 5149415, 5150066, 5149425, 9, 2569, 17, 463, 0, 5, 124025, 0, 0, 2532, 2, 5, 18, 1, 4, 13, 0, 0, 0, 2648, 16411, 16384, 54673),
(2706, 'Fury of the Storm', 'Raszageth\'s fury threatens to destroy her siblings\' prison. If she succeeds, the Incarnates will wreak havoc across Azeroth.', 1, 2, -1, 4746643, 4880696, 4880622, 9, 2522, 17, 463, 0, 3, 124022, 0, 0, 2499, 2, 5, 18, 1, 4, 13, 0, 0, 0, 2161, 16411, 16384, 54673),
